class Timing {
    constructor(startH= 0, startM= 0, endH= 0, endM= 0) {
        this.startH = startH;
        this.startM = startM;
        this.endH = endH;
        this.endM = endM;
    }

    setTiming = (startH= this.startH,
                 startM= this.startM,
                 endH= this.endH,
                 endM= this.endM) => {
        this.startH = startH;
        this.startM = startM;
        this.endH = endH;
        this.endM = endM;
    };

    storeLastValue = () => {
        this.reserveSH = this.startH;
        this.reserveSM = this.startM;
        this.reserveEH = this.endH;
        this.reserveEM = this.endM;
    }
}

export default Timing
